import React from 'react';


function App() {

  fetch('https://pokeapi.co/api/v2/pokemon/25')
  .then((res)=> {
    console.log(res.json())
    })
  .then((json) => console.log(json))
  return (
    <h1>Hello World</h1>
    )
}
export default App;
